import axios from "axios";
//axiosのインスタンスを作成
const instance = axios.create({
    //同属性の値として外部APIの共通部分のURLを記入する
    baseURL: "https://0.0.0.0:8080",
});
//インスタンスのエクスポート
export default instance;
